def filter_fields(data: dict):    filter_kwargs = {"date__year__gte": data["start_year"], "date__month__gte": data["start_month"],                     "date__month__lte": data.get("end_month") or data["start_month"],                     "date__year__lte": data.get("end_year") or data["start_year"],                     "date__day__gte": data.get("start_day") or 1, "date__day__lte": data.get("end_day") or 32,                     "date__hour__gte": data.get("start_hour") or 0, "date__hour__lte": data.get("end_hour") or 24}    return filter_kwargs